(17, 'Best ever possible composition of your lifetime. U can''t even imagine how great this composition is. And so as i need to write a long boring text u will read it untill u''r total retard. So don''t complain after coz i warned ya. Some few blah blah for test and we end here. Good job summoner!', 'At 17, Mozart was engaged as a musician at the Salzburg court, but grew restless and traveled in search of a better position. While visiting Vienna in 1781, he was dismissed from his Salzburg position. He chose to stay in the capital, where he achieved fame but little financial security. During his final years in Vienna, he composed many of his best-known symphonies, concertos, and operas, and portions of the Requiem, which was largely unfinished at the time of his death. The circumstances of his early death have been much mythologized. He was survived by his wife Constanze and two sons.', 'samples', '2016-05-01', '2016-05-03', '#coolComposition, #storyLine, #MozartDfq', '', ''),
